import React, {useState} from 'react';
import {Link} from 'react-router-dom'; 

function NavBar() {
  return 
  <>
    <nav className='navbar'>
        <div className='navbar-container'>
            <Link to = "./" className= "nav-logo">
                   <h1>Header Nav</h1> 
                 </Link>
        </div>


    </nav>



  </>;
}

export default NavBar;
